import React from "react";

const ExpenseForm = () => {
  return (
    <div>
      <form>
        <div className="container">
          <div className="row">
            <div className="col-5">
              <label htmlFor="title" className="form-label">
                Title
              </label>
              <input type="text" className="form-control" />
            </div>
            <div className="col-5">
              <label htmlFor="title" className="form-label">
                Amount
              </label>
              <input type="number" className="form-control" />
            </div>
          </div>
        </div>
      </form>
    </div>
  );
};

export default ExpenseForm;
